var findErrorNums = function(nums) {
  let stack = []; dup = -1; missing = -1;
  for (let i = 1; i <= nums.length; i++) {
    if (stack.includes(nums[i-1]) && i !== 1) {
      dup = nums[i-1];
    } else {
      stack.push(nums[i-1]);
    }
    if (!nums.includes(i)) {
      missing = i;
    }
    // console.log(stack)
  }
  return [dup, missing];
};

